// src/components/Menu.js
import React from 'react';
import { NavLink } from 'react-router-dom';
import menuData from '../data/menu.json';

const Menu = () => (
  <nav>
    <ul>
      {menuData.data.map(item => (
        <li key={item.title}>
          <NavLink to={item.url}>{item.title}</NavLink>
        </li>
      ))}
    </ul>
  </nav>
);

export default Menu;
